        "slug": "smith-wesson-m-p45-shield-45-acp-1",
        "visible": true,
        "productType": "physical",
        "description": "<p>The SMITH AND WESSON M&amp;P45 SHIELD 45 ACP is a reliable and compact semi-automatic pistol designed with the utmost precision and durability. With a capacity of 7+1 rounds, this firearm offers powerful .45 ACP ammunition for excellent stopping power. The sleek design of the M&amp;P45 SHIELD, featuring a slim profile and lightweight polymer frame, ensures comfortable handling and ease of concealment, making it an ideal choice for concealed carry or personal protection.</p><p>&nbsp;</p><p>Crafted with the highest quality materials, this pistol boasts a stainless steel slide and barrel, guaranteeing longevity and resistance to wear. The adjustable white dot sights enable quick target acquisition, enhancing accuracy in various shooting scenarios. Designed with safety in mind, the M&amp;P45 SHIELD comes with a tactile and audible trigger reset, ensuring a clear and deliberate trigger pull every time. Equipped with a textured grip, this handgun offers a secure hold, even in challenging conditions, providing confidence and control to the shooter. Whether you are a seasoned professional or an everyday gun owner, the SMITH AND WESSON M&amp;P45 SHIELD 45 ACP delivers exceptional performance and reliability, making it a top choice for anyone in need of a reliable and effective self-defense weapon.</p><p>&nbsp;</p><ul>\t<li>MANUFACTURER:&nbsp;Smith and Wesson</li>\t<li>FAMILY:&nbsp;M&amp;P Series</li>\t<li>MODEL:&nbsp;M&amp;P45 Shield</li>\t<li>TYPE:&nbsp;Semi-Auto Pistol</li>\t<li>ACTION:&nbsp;Striker Fired</li>\t<li>CALIBER/GAUGE:&nbsp;45 ACP</li>\t<li>FINISH:&nbsp;Black Melonite</li>\t<li>FRAME:&nbsp;Polymer Frame</li></ul><ul>\t<li>BARREL:&nbsp;3.3\"</li>\t<li>OVERALL LENGTH:&nbsp;6.45\"</li>\t<li>CAPACITY:&nbsp;7+1</li>\t<li># OF MAGAZINES:&nbsp;2</li>\t<li>MAG DESCRIPTION:&nbsp;One 6 rd. &amp; One 7 rd.</li>\t<li>SIGHTS:&nbsp;Fixed White Dot</li></ul><ul>\t<li>WEIGHT:&nbsp;20.5 oz.</li>\t<li>SHIPPING WEIGHT:&nbsp;2.3&nbsp;lbs.</li>\t<li>SAFETY FEATURES:&nbsp;Thumb Safety</li>\t<li>ADDL INFO:&nbsp;Massachusetts Compliant</li>\t<li>MFG MODEL NO:&nbsp;11704</li>\t<li>UPC:&nbsp;022188870503</li></ul>",
