        "name": "Benelli M4",
        "slug": "benelli-m4",
        "visible": true,
        "productType": "physical",
        "description": "<p>The Benneli M4 is a high-performance shotgun that stands out as a superior choice for both professional and recreational shooters. Designed with precision engineering and unmatched reliability, this shotgun is a testament to Benneli's commitment to excellence.</p><p>&nbsp;</p><p>The M4 features a semi-automatic action, allowing for rapid and precise firing. Its gas-piston system ensures reliable operation, regardless of the harsh conditions it may face. This makes it an ideal choice for law enforcement, military personnel, and hunters who demand peak performance.</p><p>&nbsp;</p><p>Crafted from top-notch materials, the Benneli M4 provides exceptional durability. Its tough synthetic stock and pistol grip ensure a firm and secure hold, ensuring comfort and accuracy during shooting. The shotgun's barrel is made from robust steel, ensuring longevity and resistance to wear and tear.</p><p>&nbsp;</p><p>The M4 boasts a 12-gauge chamber, capable of accommodating various types of ammunition, providing versatility in different shooting situations. It also features a detachable sling swivel, allowing for easy carrying and transport.</p><p>&nbsp;</p><p>Equipped with a ghost ring sight, the Benneli M4 offers quick target acquisition and enhanced accuracy. This sight, paired with the shotgun's adjustable rear sight, provides customizable options to suit individual shooting preferences.</p><p>&nbsp;</p><p>&nbsp;</p><p>Easy to maintain, the Benneli M4 disassembles quickly for cleaning and maintenance. This ensures that the gun remains in optimal condition for years to come, making it a reliable companion on any shooting adventure.</p><p>&nbsp;</p><p>Whether you're a professional in need of a reliable duty weapon or an avid shooter seeking a top-tier shotgun, the Benneli M4 surpasses expectations. Experience unmatched performance, durability, and versatility with this exceptional firearm. Trust in the Benneli M4 to deliver the accuracy and dependability you need when it matters most.</p><p>&nbsp;</p>",
