        "slug": "eo-tech-model-512",
        "visible": true,
        "productType": "physical",
        "description": "<p>&nbsp;</p><p>The&nbsp;<strong>HWS 512™</strong>&nbsp;is perfect for anyone who wants fast target acquisition, reliability, durability, and the anyplace availability of AA batteries without the need for night-vision compatibility. The 512 is our most popular HWS in the lineup.</p><p>&nbsp;</p><p>Included in the box:</p><ul>\t<li>HWS 512™</li>\t<li>Quick-Start Guide</li>\t<li>Warranty Card</li>\t<li>2x AA Alkaline Batteries</li>\t<li>Protective Case</li></ul><p>&nbsp;</p><p>Non-Night Vision Compatible</p><p>&nbsp;</p><p><strong>L X W X H</strong></p><p>5.6\" x 2.0\" x 2.5\" (142.2 x 50.8 x 63.5 mm)</p><p>&nbsp;</p><p><strong>Weight</strong></p><p>11.5oz (326 g)</p><p>&nbsp;</p><p><strong>Water Resistant</strong></p><p>10ft. (3 m) depth</p><p>&nbsp;</p><p><strong>Mount</strong></p><p>1\" Weaver or MIL-STD-1913 rail</p><p>&nbsp;</p><p><strong>Windage &amp; Elevation Adjustment</strong></p><p>0.5 MOA per click</p><p>&nbsp;</p><p><strong>Brightness</strong></p><p>20 daylight settings</p><p>&nbsp;</p><p><strong>Power Source</strong></p><p>2 x 1.5 V AA batteries - Supports lithium, alkaline or rechargable</p><p>&nbsp;</p><p><strong>Battery Life</strong></p><p>Lithium: 2,500 continuous hours at nominal setting 12 at room temperature<br>Alkaline: 2,200 continuous hours at nominal setting 12 at room temperature</p><p>&nbsp;</p><p><strong>Operating Temperature</strong></p><p>-40°F to 140°F (-40°C to 60°C)</p><p>&nbsp;</p><p><strong>Country of Origin</strong></p><p>Made in USA</p>",
