        "visible": true,
        "productType": "physical",
        "description": "<p>The WALTHER ARMS PPK 380 ACP is a compact and lightweight semi-automatic pistol that has gained a reputation for being reliable and accurate. It features a sleek black finish and smooth lines, resulting in an aesthetically pleasing design. This popular concealed carry choice comes with a 6-round magazine, ensuring convenient and reliable firepower. The PPK 380 ACP has a fixed steel front sight and a rear sight that is adjustable for windage, making it an excellent choice for both close range and precision shooting.</p><p>&nbsp;</p><p>With its ergonomic grip and low recoil, this pistol offers a comfortable shooting experience, making it suitable for shooters of all skill levels. In addition to its impressive performance, the WALTHER ARMS PPK 380 ACP also prioritizes safety and ease of use. It comes with a simple to use thumb safety that allows for quick and intuitive operation, ensuring user confidence in high-pressure situations. The double-action trigger system offers a smooth and consistent pull, contributing to the pistol's overall accuracy and reliability. With its compact size, superior craftsmanship, and user-friendly features, the WALTHER ARMS PPK 380 ACP is an excellent choice for concealed carry or personal defense applications.</p><p>&nbsp;</p><ul>\t<li>MANUFACTURER:&nbsp;Walther Arms</li>\t<li>FAMILY:&nbsp;PPK Series</li>\t<li>MODEL:&nbsp;PPK</li>\t<li>TYPE:&nbsp;Semi-Auto Pistol</li>\t<li>ACTION:&nbsp;Double / Single Action</li>\t<li>CALIBER/GAUGE:&nbsp;380 ACP</li>\t<li>FINISH:&nbsp;Semi-Gloss Blued</li>\t<li>FINISH TYPE:&nbsp;Blued</li>\t<li>FRAME:&nbsp;Steel Frame</li>\t<li>STOCK/GRIPS:&nbsp;Black Plastic</li>\t<li>GRIP TYPE:&nbsp;Synthetic</li></ul><ul>\t<li>BARREL:&nbsp;3.3\"</li>\t<li>OVERALL LENGTH:&nbsp;6.1\"</li>\t<li>CAPACITY:&nbsp;6 + 1</li>\t<li># OF MAGAZINES:&nbsp;2</li>\t<li>MAG DESCRIPTION:&nbsp;6 rd.</li>\t<li>SIGHTS:&nbsp;Low-Profile</li>\t<li>SIGHT TYPE:&nbsp;Fixed Sights</li></ul><ul>\t<li>WEIGHT:&nbsp;19 oz.</li>\t<li>SHIPPING WEIGHT:&nbsp;2.85&nbsp;lbs.</li>\t<li>SAFETY FEATURES:&nbsp;Manual Safety/Decocker</li>\t<li>MFG MODEL NO:&nbsp;4796002</li>\t<li>UPC:&nbsp;723364209949</li></ul>",
