        "slug": "ruger-lcr-38-special",
        "visible": true,
        "productType": "physical",
        "description": "<p>The Ruger LCR is a compact revolver built by Sturm, Ruger &amp; Co. and announced in January 2009. LCR stands for \"Lightweight Compact Revolver\". It incorporates several novel features such as a polymer grip and trigger housing, monolithic receiver, and constant force trigger.</p><p>&nbsp;</p><p>&nbsp;</p><ul>\t<li>\t<p>Monolithic frame is made from aerospace-grade, 7000-series aluminum.</p>\t</li>\t<li>\t<p>Patented friction-reducing cam is a next generation design in fire control systems that results in a smooth, non-stacking trigger pull.</p>\t</li>\t<li>\t<p>Patented polymer fire control housing holds all the fire control components in their proper dimensional relationships, reduces weight significantly and helps reduce recoil.</p>\t</li>\t<li>\t<p>High-strength stainless steel cylinder, featuring a PVD finish for excellent durability, is extensively fluted, reducing weight.</p>\t</li>\t<li>\t<p>Hogue®&nbsp;Tamer Monogrip®&nbsp;reduces perceived recoil.</p>\t</li>\t<li>\t<p>Grip peg allows for a variety of grip styles to be installed.</p>\t</li>\t<li>\t<p>Replaceable, pinned ramp front sight with white bar.</p>\t</li></ul>",
