        "description": "<p>The Henry Survival Rifle is the ultimate compact and versatile firearm designed for survivalists, outdoor enthusiasts, and anyone in search of a reliable and lightweight rifle. This exceptional firearm combines portability, accuracy, and dependability, making it an essential addition to your survival or camping gear.</p><p>&nbsp;</p><p>Crafted by the renowned Henry Repeating Arms Company, the Henry Survival Rifle boasts a compact and sturdy design. With its incredibly compact size and weighing in at just 3.5 pounds, this rifle can be easily disassembled and stored in its own impact-resistant, waterproof stock. Perfect for survival kits or backpacks, it ensures constant readiness for any situation.</p><p>&nbsp;</p><p>Featuring a reliable semi-automatic action, the Henry Survival Rifle excels in providing consistent and precise performance. Equipped with a 16.125-inch barrel, this rifle offers exceptional accuracy and an effective range suitable for hunting small game or defending oneself in survival scenarios. Its action operates smoothly, reliably ejecting spent cartridges and cycling in fresh rounds without any hassle.</p><p>&nbsp;</p><p>Built with durability in mind, the Henry Survival Rifle is constructed with high-quality materials that can withstand even the harshest elements. Its steel receiver and barrel ensure long-lasting durability, while the waterproof stock safeguards the weapon from moisture, making it suitable for all weather conditions.&nbsp;</p>",
